============================================
Description:                               =
============================================

Nuclear war, post apocalypse, barren and lifeless wastelands
 Lifeless? Not so much!
 Mutated insects have made their home in a bomb shelter and they're set on
 exploring the world
 Let this point&amp;click adventure welcome you to a hilariously bizarre end
 time world and join the roaches Jim and Bud on their journey to the surface
 Journey of a Roach tells the story of two roach-buddies, who want nothing
 but see the surface world

